import './styles/App.css';
import * as React from 'react';
import LoginPage from './components/LoginForm';

const UserAuthContext = React.createContext('false')

function App() {
  return (
    <div className="App">
      <header className="App-header">
        <p>Conversations</p>
        <UserAuthContext.Provider value="false">
          <LoginPage></LoginPage>
        </UserAuthContext.Provider>
      </header>
    </div>
  );
}


export default App;
